import matplotlib.pyplot as plt
import numpy as np
from matplotlib.gridspec import GridSpec

def plot_multiple_curves(temp_arrays, y_arrays, labels, title="Multiple Property Curves", boundaries=None):

    # Set up the plot style (similar to your existing code)
    plt.rcParams.update({
        'font.size': 10,
        'font.family': 'sans-serif',
        'axes.titlesize': 12,
        'axes.labelsize': 10,
        'xtick.labelsize': 9,
        'ytick.labelsize': 9,
        'legend.fontsize': 9,
        'figure.titlesize': 14,
        'axes.grid': True,
        'grid.alpha': 0.3,
        'grid.linestyle': '--',
        'axes.axisbelow': True,
        'figure.facecolor': 'white',
        'axes.facecolor': 'white'
    })

    # Create figure and axis
    fig, ax = plt.subplots(figsize=(12, 8))

    # Color palette for multiple curves
    colors = ['#1f77b4', '#ff7f0e', '#2ca02c', '#d62728', '#9467bd',
              '#8c564b', '#e377c2', '#7f7f7f', '#bcbd22', '#17becf']
    bounds_color = '#9467bd'  # purple for boundaries

    # Plot each curve
    for i, (temp_array, y_array, label) in enumerate(zip(temp_arrays, y_arrays, labels)):
        color = colors[i % len(colors)]  # Cycle through colors
        ax.plot(temp_array, y_array, color=color, linewidth=2.5,
                label=label, alpha=0.8)

        # Add boundary lines if provided
        if boundaries and i < len(boundaries):
            lower_bound, upper_bound = boundaries[i]
            ax.axvline(x=lower_bound, color=bounds_color, linestyle='--',
                       alpha=0.6, linewidth=1.5, label='_nolegend_')
            ax.axvline(x=upper_bound, color=bounds_color, linestyle='--',
                       alpha=0.6, linewidth=1.5, label='_nolegend_')

    # Add boundary legend entry (only once)
    if boundaries:
        ax.axvline(x=np.inf, color=bounds_color, linestyle='--',
                   alpha=0.6, linewidth=1.5, label='boundaries')

    # Customize the plot
    ax.set_title(title, fontweight='bold', pad=15)
    ax.set_xlabel("Temperature (K)", fontweight='bold')
    ax.set_ylabel("Density", fontweight='bold')

    # Grid and styling
    ax.grid(True, linestyle='--', alpha=0.3)
    ax.set_axisbelow(True)

    # Border styling
    for spine in ax.spines.values():
        spine.set_color('#CCCCCC')
        spine.set_linewidth(1.2)

    # Legend
    legend = ax.legend(loc='best', framealpha=0.9, fancybox=True,
                       shadow=True, edgecolor='gray')
    legend.get_frame().set_linewidth(1.2)

    # Tight layout
    plt.tight_layout()

    return fig, ax

